def color_dodge_8(base: List[List[int]], active: List[List[int]]) -> List[List[int]]:
    return matrix_where(
        active,
        matrix_where(
            scalar_matrix_div(32, matrix_scalar_sub(32, active)),
            base,
            lambda x, y: y
        ),
        lambda a, b: ite(a == 32, 32, b)
    )
